import './App.css'
import Intro from "./Componentes/Intro/Intro";
import Servicios from "./Componentes/Servicios/Servicios";
import Experience from "./Componentes/Experience/experience"

function App() {
  return (
    <div className="App">
    <Navbar/>
    <Intro/>
    <Servicios/>
    <Experience/>
    </div>
  );
}

export default App;
